generateXMLCode :: [(C.ByteString, Double)] -> [(Double, String)] -> [Text.XML.Node]
generateXMLCode districtValList colorGradient = [xml|

    <defs>
        <linearGradient x1="402" y1="970" x2="702" y2="970" gradientUnits="userSpaceOnUse" id="lGr">
        
            $forall (colorString, offset) <- colorOffsetList
                <stop offset="#{pack $ show offset}" style="stop-color:##{pack colorString}">

    <style type="text/css">
        text {font-family:monospace,Courier New,Liberation Mono;font-size:14px}
        path {stroke:#fff;stroke-width:0.3}
        path:hover {stroke-width:1.5}

    <g id="legend">
        <text x="611" y="960">  1 / 100 000

        <rect style="fill:url(#lGr);fill-opacity:1" height="20" width="300" x="402" y="970">
        <path d="m402,990v6h2v-4h47.7v4h2v-4h47.6v4h2v-4H551v4h2v-4h47.6v4h2v-4h47.7v4h2v-4H700v4h2v-6z" style="fill:#000000;stroke-width:0">

        <text x="390" y="1010">    >0
        <text x="435.2" y="1010">  25
        <text x="485" y="1010">    50
        <text x="531" y="1010">    100
